import { Component, OnInit } from '@angular/core';
import { LeaderboardService } from '../leaderboard.service';

@Component({
  selector: 'app-q8',
  templateUrl: './q8.component.html',
  styleUrls: ['./q8.component.css']
})
export class Q8Component implements OnInit{
  BestWinLosses: BestGame[] = [];

  constructor(
    private leaderboardService: LeaderboardService,
  ) { }

  ngOnInit(): void {
    this.leaderboardService.getWinLoss()
      .subscribe(BestWinLosses => this.BestWinLosses = BestWinLosses);
  }
}
<p>q8 works!</p>
<div class="content-box">
    <a routerLink="/query">
        <button>Back</button>
    </a>
</div>
